import React, {useState, useEffect} from 'react';
import {Carousel} from 'react-bootstrap';

function ReturnCarouselImages(props) {

	let imagePath = props.imagePath;

	return(
		<div>
			<Carousel.Item>
				<img
				className=""
				src={require(imagePath)}
				alt='BlogImages'
				/>
			</Carousel.Item>
		</div>
	);
}

export default ReturnCarouselImages;
